      <div className="contact-us">


      
        <form >
          <input type='text' name="fname" placeholder='Enter Your Name' ref={register} /> <br></br>
          <input type='text' name="email" placeholder='Enter a valid email address ' ref={register} /><br></br>
           <textarea name="message" rows="10" cols="60" placeholder= 'Enter your message' ref={register}>     </textarea><br></br>
           <input type="submit"  value="submit" />
        </form>
         
        
      
          
      </div>
     
    );
}
  
